// TODO(clocksmith): Refactor since this is copied from ink_ripple.dart
RectCallback? _getClipCallback(
  RenderBox referenceBox,
  bool containedInkWell,
  RectCallback? rectCallback,
) {
  if (rectCallback != null) {
    assert(containedInkWell);
    return rectCallback;
  }
  if (containedInkWell) return () => Offset.zero & referenceBox.size;
  return null;
}

// TODO(clocksmith): Refactor since this is copied from ink_ripple.dart
double _getTargetRadius(
  RenderBox referenceBox,
  bool containedInkWell,
  RectCallback? rectCallback,
  Offset position,
) {
  final Size size =
      rectCallback != null ? rectCallback().size : referenceBox.size;
  final double d1 = size.bottomRight(Offset.zero).distance;
  final double d2 =
      (size.topRight(Offset.zero) - size.bottomLeft(Offset.zero)).distance;
  return math.max(d1, d2) / 2.0;
}

  /// Begin an m3 sparkle ripple, centered at [position] relative to
  /// [referenceBox].
  ///
  /// The [controller] argument is typically obtained via
  /// `Material.of(context)`.
  ///
  /// If [containedInkWell] is true, then the ripple will be sized to fit
  /// the well rectangle, then clipped to it when drawn. The well
  /// rectangle is the box returned by [rectCallback], if provided, or
  /// otherwise is the bounds of the [referenceBox].
  ///
  /// If [containedInkWell] is false, then [rectCallback] should be null.
  /// The ink ripple is clipped only to the edges of the [Material].
  /// This is the default.
  ///
  /// When the ripple is removed, [onRemoved] will be called.
class InkSparkle extends InteractiveInkFeature {
  InkSparkle({
    required MaterialInkController controller,
    required RenderBox referenceBox,
    required Offset position,
    required Color color,
    required TextDirection textDirection,
    bool containedInkWell = true,
    RectCallback? rectCallback,
    BorderRadius? borderRadius,
    ShapeBorder? customBorder,
    double? radius,
    VoidCallback? onRemoved,
  })  : _color = color,
        _rectCallback = rectCallback,
        _position = position,
        _borderRadius = borderRadius ?? BorderRadius.zero,
        _customBorder = customBorder,
        _textDirection = textDirection,
        _targetRadius = radius ??
            _getTargetRadius(
                referenceBox, containedInkWell, rectCallback, position),
        _clipCallback =
            _getClipCallback(referenceBox, containedInkWell, rectCallback),
        super(
            controller: controller,
            referenceBox: referenceBox,
            color: color,
            onRemoved: onRemoved) {
    controller.addInkFeature(this);

    FragmentShaderManager.inkSparkle().then((value) {
      _shaderManager = value;
    });

    _ticker = controller.vsync.createTicker((elapsed) {
      _time = elapsed;
      controller.markNeedsPaint();
    });
    _ticker.start();
  }

  late Ticker _ticker;
  Duration _time = Duration.zero;
  int _timeUpMillis = 0;

  FragmentShaderManager? _shaderManager;
  final Color _color;
  final RectCallback? _rectCallback;

  final Offset _position;
  final BorderRadius _borderRadius;
  final ShapeBorder? _customBorder;
  final double _targetRadius;
  final RectCallback? _clipCallback;
  final TextDirection _textDirection;

  /// Used to specify this type of ink splash for an [InkWell], [InkResponse],
  /// material [Theme], or [ButtonStyle].
  static const InteractiveInkFeatureFactory splashFactory = InkSparkleFactory();

  @override
  void confirm() {
    // This method is only called on press up.
    _timeUpMillis = _time.inMilliseconds;
    // TODO(clocksmith): Verify value for ripple settle time.
    Timer(const Duration(milliseconds: 150), () {
      _ticker.stop();
      _time = Duration.zero;
    });
  }

  @override
  void cancel() {
    print('sparkle cancel');
    _ticker.stop();
  }

  @override
  void dispose() {
    _ticker.stop();
    _ticker.dispose();
    super.dispose();
  }

  @override
  void paintFeature(Canvas canvas, Matrix4 transform) {
    print('sparkle paintFeature');
    // Can only paint after the shader has been compiled
    // and the _shaderManager has been initialized
    if (_shaderManager == null) return;
    print('sparkle shader ready - continuing paintFeature');

    final timeMillis = _time.inMilliseconds.toDouble();
    final timeTouchUpMillis = _timeUpMillis.toDouble();

    if (timeMillis != 0) {
      canvas.save();
      transformCanvas(canvas: canvas, transform: transform);
      if (_clipCallback != null) {
        clipCanvas(
          canvas: canvas,
          clipCallback: _clipCallback!,
          textDirection: _textDirection,
          customBorder: _customBorder,
          borderRadius: _borderRadius,
        );
      }

      double normalizeColorChannel(int c) => c / 255.0;

      final shader = _shaderManager!.shader(
        uColor: Vector4(
          normalizeColorChannel(_color.red),
          normalizeColorChannel(_color.blue),
          normalizeColorChannel(_color.green),
          normalizeColorChannel(_color.alpha),
        ),
        uResolution: Vector2(referenceBox.size.width, referenceBox.size.height),
        uTouch: Vector2(_position.dx, _position.dy),
        uTime: timeMillis,
        uTouchUp: timeTouchUpMillis,
        uRippleDurationMs: 3000, // TODO(clocksmith): Confrim value
        uPauseInflection: 0.185,
        uPostPauseTimeScale: 1.5,
        uPixelDensity: 1.0,
      );

      Paint paint = Paint()..shader = shader;
      if (_clipCallback != null) {
        canvas.drawRect(_clipCallback!(), paint);
      } else {
        canvas.drawPaint(paint);
      }
      canvas.restore();
    }
  }
}

class InkSparkleFactory extends InteractiveInkFeatureFactory {
  const InkSparkleFactory();

  @override
  InteractiveInkFeature create({
    required MaterialInkController controller,
    required RenderBox referenceBox,
    required ui.Offset position,
    required ui.Color color,
    required ui.TextDirection textDirection,
    bool containedInkWell = false,
    RectCallback? rectCallback,
    BorderRadius? borderRadius,
    ShapeBorder? customBorder,
    double? radius,
    ui.VoidCallback? onRemoved,
  }) {
    return InkSparkle(
      controller: controller,
      referenceBox: referenceBox,
      position: position,
      color: color,
      containedInkWell: containedInkWell,
      rectCallback: rectCallback,
      borderRadius: borderRadius,
      customBorder: customBorder,
      radius: radius,
      onRemoved: onRemoved,
      textDirection: textDirection,
    );
  }
}

